import '../style/App.css';

class App extends React.Component{
  render(){
    return(
      <div >
        <div >
          <h1 className="mainBody-text">Get in control with Back of House</h1>
          <h2 className="mainBody-subheading">Kitchen Management Software</h2>
        </div>
      </div>
    )
  }
}

export default App;
